import React from 'react';
import './Sidebar.css';
import { Link } from 'react-router-dom';

const Sidebar = () => {
    const navigate = useNavigate();
    return (
        <div className="sidebar">
            <h2>PDF Uploader</h2>
            <nav>
                <ul>
                    <li className="sidebar-item" onClick={() => navigate('/')}>
                        ホーム
                    </li>
                </ul>
            </nav>
        </div>
    );
};

export default Sidebar;
